import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  componentDidMount() {
    fetch("http://localhost:5000/projects/1", {
      method: "get",
      mode: "no-cors"

    })
      .then(results => {
        console.log(results);
        return results.json();
      })
      .then(data => {
        console.log(data);
        this.setState({ projectList: data.results });
      })
      .catch(err => {
        console.log(err);
      });
  }

  render() {
    return <Project projectList={this.state.projectList} />;
  }
}

export default Projects;
